import React from "react";
import { Form, Button } from "react-bootstrap";
import "bootstrap";

const Comp = (props) => {
  const {
    A,
    setA,
    B,
    setB,
    C,
    setC,
    D,
    setD,
    E,
    setE,
    F,
    setF,
    G,
    setG,
    H,
    setH,
    I,
    setI,
    answer,
    setAnswer,
    handleSubmit,
  } = props;
  return (
    <section className="cotainer">
      <div>
        <h2>TWF FLOURS</h2>
        <div className="row">
        <label>A</label>
        <input
          type="text"
          autoFocus
          required
          value={A}
          onChange={(e) => setA(e.target.value)}
        />
        <label>B</label>
        <input
          type="text"
          autoFocus
          required
          value={A}
          onChange={(e) => setB(e.target.value)}
        />
        </div>
        <button onClick={handleSubmit}>Submit</button>
      </div>
    </section>
  );
};

export default Comp;
